asas/if-statement.html.body:
If statement
If statement membolehkan program untuk membuat pilihan.
Berikut ialah program yang hanya akan paparkan nombor jika nombor
tersebut ialah nombor genap:
public class TutorialIf {
    public static void main(String[] args) {
        int nombor = 4;
        int baki = nombor % 2;

        if (baki == 0) {
            System.out.println(nombor + " ialah nombor genap");
        }
    }
}

Hasilnya, terpapar 4 ialah nombor genap.
Sekarang tukar nombor kepada nombor ganjil:
public class TutorialIf {
    public static void main(String[] args) {
        int nombor = 5;
        int baki = nombor % 2;

        if (baki == 0) {
            System.out.println(nombor + " ialah nombor genap");
        }
    }
}

dan hasilnya tiada apa-apa yang terpapar.
Sebelum kita pergi kepada penerangan tentang code di atas, kita perlu tahu cara
untuk menentukan nombor genap. Nombor genap tidak akan berbaki apabila dibahagi
dengan dua, contohnya 10 bahagi 2 bersamaan 5 baki 0. Berlainan dengan nombor
ganjil, contohnya 9 bahagi 2 bersamaan 4 baki 1.
Oleh itu, penentu kepada nombor genap ialah baki selepas nombor tersebut
dibahagi dengan dua. Untuk mendapatkan baki, kita gunakan simbol %.
Jadi, program tersebut akan check sama ada baki sama dengan 0 dengan
menggunakan simbol ==. Jika ya, program akan laksanakan if statement
tersebut. Jika tidak, program akan abaikan.
Inilah yang dinamakan membuat pilihan (decision making), maksudnya
program boleh membuat pilihan sama ada untuk laksanakan code ataupun
tidak.
Sekarang kita tambah code kita untuk paparkan jika nombor tersebut ialah
nombor ganjil:
public class TutorialIf {
    public static void main(String[] args) {
        int nombor = 5;
        int baki = nombor % 2;

        if (baki == 0) {
            System.out.println(nombor + " ialah nombor genap");
        }

        if (baki != 0) {
            System.out.println(nombor + " ialah nombor ganjil");
        }
    }
}

dan barulah terpapar 5 ialah nombor ganjil. Perhatikan simbol !=
digunakan untuk check sama ada "baki tidak sama dengan 0".
If else statement
Sekarang cuba code berikut dan lihat apa yang berlaku:
public class TutorialIfElse {
    public static void main(String[] args) {
        int umur = 60;

        if (umur > 50) {
            System.out.println("tua");
        }

        if (umur > 20) {
            System.out.println("dewasa");
        }
    }
}

Program akan memaparkan kedua-duanya. Jika kita mahu paparkan hanya salah
satu daripada pilihan tersebut, kita boleh menggunakan if else
statement, seperti berikut:
public class TutorialIfElse {
    public static void main(String[] args) {
        int umur = 60;

        if (umur > 50) {
            System.out.println("tua");
        } else if (umur > 20) {
            System.out.println("dewasa");
        }
    }
}

Barulah satu pilihan sahaja yang terpilih, iaitu tua.
Kita juga boleh menggunakan else tanpa meletakkan if. Ini akan
membuatkan program akan pilih pilihan tersebut jika semua pilihan di
atasnya tidak terpilih. Contoh seperti berikut:
public class TutorialIfElse {
    public static void main(String[] args) {
        int umur = 5;

        if (umur > 50) {
            System.out.println("tua");
        } else if (umur > 20) {
            System.out.println("dewasa");
        } else {
            System.out.println("kecik lagi");
        }
    }
}

else tanpa if merupakan pilihan terakhir bagi code tersebut.
Kita boleh menulis semula code untuk nombor genap menggunakan cara yang
sama:
public class TutorialIfElse {
    public static void main(String[] args) {
        int nombor = 5;
        int baki = nombor % 2;

        if (baki == 0) {
            System.out.println(nombor + " ialah nombor genap");
        } else {
            System.out.println(nombor + " ialah nombor ganjil");
        }
    }
}

barulah nampak lebih kemas.
Nested if statement
Nested if statement bermaksud apabila if statement berada di dalam
if statement yang lain. Contohnya:
public class TutorialNestedIf {
    public static void main(String[] args) {
        int umur = 5;

        if (umur >= 0) {    // umur tak boleh negatif
            if (umur > 20) {
                System.out.println("dewasa");
            } else {
                System.out.println("kanak-kanak");
            }
        }
    }
}

asas/switch-statement.html.body:
Switch statement
Switch statement adalah sama dengan if statement iaitu untuk
membolehkan program membuat pilihan (decision making). Switch
statement biasa digunakan jika pilihan terlalu banyak.
public class TutorialSwitch {
    public static void main(String[] args) {
        int bulan = 5;

        switch (bulan) {
        case 1:  System.out.println("Januari"); break;
        case 2:  System.out.println("Februari"); break;
        case 3:  System.out.println("Mac"); break;
        case 4:  System.out.println("April"); break;
        case 5:  System.out.println("Mei"); break;
        case 6:  System.out.println("Jun"); break;
        case 7:  System.out.println("Julai"); break;
        case 8:  System.out.println("Ogos"); break;
        case 9:  System.out.println("September"); break;
        case 10: System.out.println("Oktober"); break;
        case 11: System.out.println("November"); break;
        case 12: System.out.println("Disember"); break;
        default: System.out.println("bulan tidak wujud"); break;
        }
    }
}

Kurungan selepas switch diletakkan variable yang digunakan untuk
perbandingan. Data selepas case diletakkan perbandingan yang ada.
Jadi, case 1 bermaksud adakah bulan sama dengan 1? Jika ya, code
selepasnya akan dilaksanakan. Akhir sekali, diletakkan break
menandakan berakhirnya code yang perlu dilaksanakan.
default adalah sama dengan else dalam if statement iaitu
merupakan pilihan terakhir untuk code tersebut.
Kelebihan menggunakan switch adalah untuk memudahkan orang membaca
code tersebut (readability). Jika anda mahu, anda boleh tulis semua
code tersebut menggunakan if statement.

P/S: Jangan lupa untuk menulis break selepas setiap
case kerana walaupun code tiada error, akan berlaku sesuatu yang
anda tidak jangkakan. Anda boleh cuba buang break untuk lihat apa
yang akan berlaku.

asas/boolean.html.body:
Boolean
Salah satu jenis data ialah boolean. Boolean hanya boleh menyimpan dua
jenis data sahaja iaitu; true atau false. Jadi, di mana boleh kita
menggunakan boolean ini?
Cuba ingat kembali kurungan pada if statement, while loop, dan do
while loop di mana kita membuat perbandingan antara dua nombor.
Sebenarnya, apabila kita membuat perbandingan, kita telah menghasilkan
boolean. Buktinya:
public class TutorialBoolean {
    public static void main(String[] args) {
        boolean b = 5 > 3;
        System.out.println(b);  // akan papar 'true'
    }
}

Jadi, variable boolean boleh digunakan di dalam kurungan tersebut,
contohnya:
public class TutorialBoolean {
    public static void main(String[] args) {
        int nombor = 4;
        int baki = nombor % 2;
        boolean tiadaBaki = (baki == 0);

        if (tiadaBaki) {
            System.out.println("nombor genap");
        }
    }
}

Cara ini biasa digunakan untuk membuatkan code lebih mudah dibaca tanpa
perlu menggunakan comment.

oop/class-part-1.html.body:
Class (part 1)
Buka Netbeans (atau mana-mana IDE yang anda guna), kemudian buat New
project. Namakan project tersebut apa-apa sahaja yang anda mahu.
Untuk membuat class, klik kanan pada Source Packages dan klik
New Java Class. Kita namakan class tersebut sebagai
Kucing, dan nama package sebagai kucing. Selepas tekan
Finish, Netbeans akan menghasilkan file berikut:
package kucing;

public class Kucing {

}

Fields
Fields ialah variable yang kita letakkan pada class, seperti
berikut:
package kucing;

public class Kucing {
    String nama;
    int umur;
}

Fields inilah yang dikatakan ciri-ciri kepada sesuatu class. Jadi,
ciri-ciri untuk class Kucing sekarang ialah nama dan umur.
Methods
Methods menentukan tingkah laku yang boleh dilakukan oleh class
tersebut. Contohnya,
package kucing;

public class Kucing {
    String nama;
    int umur;

    public void mengiau() {
        System.out.println("Meow");
    }

    public void minum() {
        System.out.println("Slrrp, slrrp");
    }
}

Jadi, tingkah laku yang boleh dilakukan oleh class Kucing sekarang ialah
mengiau dan minum.

oop/object.html.body:
Object
Setelah berjaya membuat class Kucing, barulah kita boleh membuat
object untuk class tersebut.
Menggunakan project yang sama dengan sebelum ini, klik kanan pada
package kucing dan klik New Java Class. Kita boleh namakan
apa-apa sahaja, jadi kita letakkan Main sebagai nama class. Selepas
klik Finish, Netbeans akan menghasilkan file berikut:
package kucing;

public class Main {

}

Dalam Java, mula-mula sekali program akan run method main(). Jadi,
kita tambah method main() tersebut dalam class Main, seperti
berikut:
package kucing;

public class Main {
    public static void main(String[] args) {

    }
}

Sekarang barulah kelihatan sama seperti program yang pernah kita lihat sebelum
ini.
Create object
Untuk membuat object, kita tentukan class, nama untuk
object tersebut, dan keyword new. Contohnya,
package kucing;

public class Main {
    public static void main(String[] args) {
        Kucing kucingSaya = new Kucing();
    }
}

Selepas create object, kita boleh mengakses fields untuk object
tersebut dengan menggunakan titik noktah:
package kucing;

public class Main {
    public static void main(String[] args) {
        Kucing kucingSaya = new Kucing();
        kucingSaya.nama = "Tompok";
        kucingSaya.umur = 5;
    }
}

Kita juga boleh menggunakan methods dari object tersebut menggunakan
titik noktah dan diakhiri dengan kurungan:
package kucing;

public class Main {
    public static void main(String[] args) {
        Kucing kucingSaya = new Kucing();
        kucingSaya.nama = "Tompok";
        kucingSaya.umur = 5;
        kucingSaya.mengiau();
    }
}

Untuk create lebih daripada satu object, kita boleh menggunakan nama yang lain
untuk object tersebut, contohnya kucingKawanSaya seperti berikut:
package kucing;

public class Main {
    public static void main(String[] args) {
        Kucing kucingSaya = new Kucing();
        kucingSaya.nama = "Tompok";
        kucingSaya.umur = 5;
        kucingSaya.mengiau();

        Kucing kucingKawanSaya = new Kucing();
        kucingKawanSaya.nama = "Comel";
        kucingKawanSaya.umur = 6;
        kucingKawanSaya.minum();
    }
}

oop/class-part-2.html.body:
Class (part 2)
Kita kembali kepada class Kucing untuk menambah sesuatu pada
class tersebut, iaitu constructor, setter, dan getter. Kita juga
akan melihat pengenalan kepada parameter.
Constructor
Constructor ialah method yang mempunyai nama yang sama dengan nama
class. Tujuannya adalah untuk melaksanakan sesuatu code sebaik
sahaja kita create object daripada class tersebut. Kebiasaannya
kita letak proses untuk memasukkan data ke dalam fields di dalam
constructor, contohnya:
package kucing;

public class Kucing {
    String nama;
    int umur;

    /*
     * Inilah yang dinamakan constructor.
     */
    public Kucing() {
        nama = "Tiada nama";
        umur = 0;
    }

    public void mengiau() {
        System.out.println("Meow");
    }

    public void minum() {
        System.out.println("Slrrp, slrrp");
    }
}

Ini untuk mengelakkan error, contohnya jika kita mengakses fields
walaupun fields tersebut tidak mempunyai data.
Untuk melihat fungsi constructor, kita boleh create object daripada
class Kucing:
package kucing;

public class Main {
    public static void main(String[] args) {
        Kucing kucingSaya = new Kucing();

        System.out.println(kucingSaya.nama);
    }
}

Lihat, kita tidak perlu memasukkan data ke dalam fields seperti
sebelum ini. Program secara automatik akan memasukkan data ke
dalam fields bergantung kepada apa yang kita tentukan di dalam
constructor.
Setter
Setter ialah method yang digunakan untuk memasukkan data ke dalam
fields.
package kucing;

public class Kucing {
    String nama;
    int umur;

    public Kucing() {
        nama = "Tiada nama";
        umur = 0;
    }

    /*
     * Ini contoh setter.
     */
    public void setNama(String n) {
        nama = n;
    }

    public void mengiau() {
        System.out.println("Meow");
    }

    public void minum() {
        System.out.println("Slrrp, slrrp");
    }
}

String n yang berada di dalam kurungan setNama() ialah
parameter. Parameter ialah data yang diperlukan untuk menggunakan
method tersebut. Contoh kegunaan setter adalah seperti berikut:
package kucing;

public class Main {
    public static void main(String[] args) {
        Kucing kucingSaya = newKucing();
        kucingSaya.setNama("Tompok");
    }
}

Antara kelebihan menggunakan setter ialah kita dapat memastikan data
yang dimasukkan adalah data yang betul. Contohnya umur tidak boleh
menjadi negatif, jadi kita boleh pastikan nombor yang dimasukkan bukan
nombor negatif seperti berikut:
package kucing;

public class Kucing {
    ...

    public void setUmur(int u) {
        if (u 
Getter
Getter pula ialah method untuk mengakses data. Berbeza dengan method sebelum
ini, kita perlu menukar keyword void kepada jenis data yang kita ingin akses.
Contohnya, jika kita mahu mengakses data dari field nama, kita perlu tukar
void kepada String:
package kucing;

public class Kucing {
    String nama;
    int umur;

    ...
    public String getNama() {
        return nama;
    }

    public int getUmur() {
        return umur;
    }
    ...
}

Keyword return digunakan untuk mengakses data tersebut atau dalam
erti kata lain memulangkan data.
Kita boleh menggunakan getter seperti berikut:
package kucing;

public class Main {
    public static void main(String[] args) {
        Kucing kucingSaya = new Kucing();
        System.out.println(kucingSaya.getNama());
    }
}

oop/access-modifiers.html.body:
Access modifiers
Access modifiers ialah keyword yang digunakan untuk menentukan sama
ada class, fields, atau methods boleh diakses ataupun tidak.
Keyword tersebut ialah public, private, dan protected.
Public
Apabila keyword public digunakan bermakna class, fields, atau
methods tersebut boleh digunakan di mana-mana sahaja.
Private
Keyword private pula hanya boleh digunakan oleh code di dalam class
itu sahaja. Keyword private biasanya diletakkan pada fields. Sebagai
contoh:
package kucing;

public class Kucing {
    private String nama;
    private int umur;

    ...

    public String getNama() {
        return nama;
    }

    public int getUmur() {
        return umur;
    }
    ...
}

Selepas meletakkan keyword private, maka kita tidak boleh compile code
berikut:
package kucing;

public class Main {
  public static void main(String[] args) {
    Kucing kucingSaya = new Kucing();
    System.out.println(kucingSaya.nama); // error di sini
  }
}

Antara kelebihan menggunakan private adalah bagi memastikan code tidak
boleh mengubah fields secara langsung (direct) kerana data untuk
fields tersebut perlu dipastikan terlebih dahulu melalui setter.
Tiada modifier
Jika kita tidak meletakkan modifier, hanya code dalam class dan
package yang sama sahaja yang boleh akses.
Protected
Keyword protected hampir sama dengan yang tiada modifier, dengan
tambahan code di dalam subclass di package lain juga boleh akses.
Lihat topik inheritance untuk mengetahui dengan lebih lanjut mengenai
subclass.

oop/class-part-3.html.body:
Class (part 3)
Kita kembali semula ke class Kucing, dan kita akan membuat sesuatu yang
dipanggil sebagai constructor overloading dan method overloading.
Kita juga akan melihat pengenalan kepada keyword this.
Constructor overloading
Constructor overloading bermaksud kita letakkan lebih daripada satu
constructor untuk class tersebut, dengan syarat parameter mereka
berlainan. Contohnya,
package kucing;

public class Kucing {
    private String nama;
    private int umur;

    public Kucing() {
        nama = "Tiada nama";
        umur = 0;
    }

    public Kucing(String n, int u) {
        nama = n;
        umur = u;
    }

    ...

Jadi, kita boleh tentukan constructor mana yang hendak digunakan
semasa create object:
package kucing;

public class Main {
    public static void main(String[] args) {
        Kucing kucingSaya = new Kucing();
        Kucing kucingKawanSaya = new Kucing("Comel", 10);

        System.out.println(kucingSaya.getNama());
        System.out.println(kucingKawanSaya.getNama());
    }
}

Method overloading
Method overloading juga sama, kita boleh meletakkan lebih daripada satu
method yang mempunyai nama yang sama, dengan syarat parameter mereka
berlainan. Contohnya method setNama(),
    ...

    public void setNama() {
        nama = "Tiada nama";
    }

    public void setNama(String n) {
        nama = n;
    }

    ...

dan kita boleh memilih untuk menggunakan method yang mana berdasarkan
parameter yang kita letakkan:
package kucing;

public class Main {
    public static void main(String[] args) {
        Kucing kucingSaya = new Kucing();

        kucingSaya.setNama("Comel");
        System.out.println(kucingSaya.getNama());

        kucingSaya.setNama();
        System.out.println(kucingSaya.getNama());
    }
}

Keyword 'this'
Keyword this digunakan untuk merujuk 'object ini'. Antara kegunaannya adalah
untuk menentukan variable yang mana kita mahu gunakan. Contohnya apabila nama
parameter adalah sama dengan nama field, seperti berikut:
    ...

    private String nama;
    private int umur;

    public Kucing() {
        nama = "Tiada nama";
        umur = 0;
    }

    public Kucing(String nama, int umur) {
        this.nama = nama;
        this.umur = umur;
    }

    ...
}

Jadi, this.nama = nama bermaksud untuk 'nama object ini' kita masukkan data
daripada parameter 'nama'.
Satu lagi kegunaannya adalah untuk menghantar data dari parameter ke
constructor yang lain, contohnya:
package kucing;

public class Kucing {

    private String nama;
    private int umur;

    public Kucing() {
        this("Tiada nama", 0);  // akan hantar ke Kucing(String nama, int umur)
    }

    public Kucing(String nama, int umur) {
        this.nama = nama;
        this.umur = umur;
    }

    ...
}

Oleh itu, kita boleh tulis semula class Kucing menggunakan keyword this,
seperti berikut:
