oop/interface.html.body:
Interface
Dalam sesetengah projek, ada masa code ditulis oleh beberapa orang
programmer. Contohnya, seorang mungkin buat class Kucing, dan seorang
lagi menggunakan class Kucing di method main(). Jadi, mereka
perlulah tahu apa yang boleh dilakukan oleh class Kucing. Oleh itu,
interface digunakan untuk menentukan apa yang patut ada pada class
Kucing.
Untuk membuat interface, klik kanan pada package kucing, kemudian
klik New Java Interface. Kita boleh namakan apa-apa sahaja, jadi
kita namakan interface ini sebagai HaiwanBergerak. Selepas klik
Finish, Netbeans akan menghasilkan file berikut:
package kucing;

public interface HaiwanBergerak {

}

Untuk menambah fungsi HaiwanBergerak, kita boleh buat seperti sewaktu
menghasilkan method. Cuma bezanya method di interface tidak ada
curly braces, {}. Contohnya,
package kucing;

public interface HaiwanBergerak {
    void jalan();
    void lari();
    void lompat();
}

Dengan ini, mana-mana class yang menggunakan interface
HaiwanBergerak wajib menambah method jalan(), lari(), dan lompat().
implements
Keyword implements boleh diletakkan pada class untuk menggunakan
sesuatu interface. Contohnya,
package kucing;

public class Kucing implements HaiwanBergerak {
    private String nama;
    private int umur;

    public Kucing(String nama, int umur) {
        this.nama = nama;
        this.umur = umur;
    }
}

Kemudian kita wajib menambah method pada class Kucing mengikut
method yang ada pada interface HaiwanBergerak, seperti berikut:
package kucing;

public class Kucing implements HaiwanBergerak {
    private String nama;
    private int umur;

    public Kucing(String nama, int umur) {
        this.nama = nama;
        this.umur = umur;
    }

    @Override
    public void jalan() {

    }

    @Override
    public void lari() {

    }

    @Override
    public void lompat() {

    }
}

@Override ditambah bertujuan untuk memberitahu compiler bahawa kita
tahu apa yang kita tengah buat. Kemudian, kita boleh tambah code dalam
methods tersebut bergantung kepada apa yang kita mahu:
package kucing;

public class Kucing implements HaiwanBergerak {
    private String nama;
    private int umur;

    public Kucing(String nama, int umur) {
        this.nama = nama;
        this.umur = umur;
    }

    @Override
    public void jalan() {
        System.out.println("Jalan...");
    }

    @Override
    public void lari() {
        System.out.println("Lari!");
    }

    @Override
    public void lompat() {
        System.out.println("Lompat!");

    }
}

Kita juga boleh menggunakan lebih daripada satu interface pada satu
class, contohnya:
package kucing;

public class Kucing implements HaiwanBergerak, HaiwanBeranak {
    private String nama;
    private int umur;

    public Kucing(String nama, int umur) {
        this.nama = nama;
        this.umur = umur;
    }

    @Override
    public void jalan() {
        System.out.println("Jalan...");
    }

    @Override
    public void lari() {
        System.out.println("Lari!");
    }

    @Override
    public void lompat() {
        System.out.println("Lompat!");
    }

    @Override
    public void beranak() {
        System.out.println("Beranak!!!!!");
    }
}

Antara kelebihan menggunakan IDE seperti Netbeans ialah IDE boleh
menambah methods daripada interface tersebut secara automatik.

oop/inheritance.html.body:
Inheritance
Tujuan kita membuat inheritance adalah untuk menggunakan semula class
yang sedia ada, dan membuat sedikit pengubahsuaian tanpa mengubahsuai
class yang asal.
Kita gunakan class Kucing sebagai class yang asal, dan kita ubahsuai
class tersebut kepada class KucingParsi. Class Kucing adalah
seperti berikut:
package kucing;

public class Kucing {
    private String nama;
    private int umur;

    public Kucing() {
        nama = "Comel";
        umur = 5;
    }

    public void mengiau() {
        System.out.println("Meow");
    }

    public void minum() {
        System.out.println("Slrpp, slrppp");
    }
}

Kemudian kita buat class baru dengan nama KucingParsi. Untuk membuat
inheritance, kita gunakan keyword extends seperti berikut:
package kucing;

public class KucingParsi extends Kucing {

}

Sekarang KucingParsi secara automatik sudah mempunyai semua code yang ada di
dalam class Kucing. Buktinya kita boleh cuba create object daripada
class KucingParsi:
package kucing;

public class Main {
    public static void main(String[] args) {
        KucingParsi kucingSaya = new KucingParsi();
        kucingSaya.minum();
    }
}

Kita boleh tambah method seperti biasa pada class KucingParsi
seperti ini:
package kucing;

public class KucingParsi extends Kucing {
    public void makan() {
        System.out.println("Makan...");
    }
}

Method overriding
Kita juga boleh ubahsuai method yang sedia ada. Cara ini dipanggil
method overriding. Kita boleh override method minum()
seperti berikut:
package kucing;

public class KucingParsi extends Kucing {
    public void makan() {
        System.out.println("Makan...");
    }

    @Override
    public void minum() {
        System.out.println("Slrplrprlprlprrpl");
        System.out.println("Slrrrrrrrrrrrrp");
    }
}

Superclass vs subclass
Setelah membuat inheritance, class yang asal dinamakan sebagai
'superclass', manakala class yang baru dinamakan sebagai
'subclass'. Oleh itu,

Kucing ialah superclass kepada KucingParsi
KucingParsi ialah subclass daripada Kucing

Keyword super
Kegunaan keyword super adalah sama dengan keyword this. Bezanya
ialah keyword super merujuk kepada superclass. Contohnya, apabila
constructor class Kucing mempunyai parameter seperti berikut:
package kucing;

public class Kucing {
    private String nama;
    private int umur;

    public Kucing(String nama, int umur) {
        this.nama = nama;
        this.umur = umur;
    }

    ...

maka kita boleh menggunakan keyword super untuk menghantar data dari
subclass ke superclass seperti ini:
package kucing;

public class KucingParsi extends Kucing {

    public KucingParsi(String nama, int umur) {
        super(nama, umur);
    }

    ...

oop/polymorphism.html.body:
Polymorphism
Istilah polymorphism diambil daripada konsep biologi yang menyatakan
setiap spesies boleh mempunyai beberapa bentuk, contohnya spesies
harimau ada harimau belang, jaguar, cheetah, dan sebagainya.
Setiap harimau tersebut mempunyai ciri-ciri dan tingkahlaku yang
tersendiri tetapi melakukan benda yang sama, contohnya harimau belang
menghendap di sebalik semak dahulu sebelum menerkam mangsa, cheetah
gunakan kepantasan untuk menangkap mangsa, tetapi kedua-duanya bertujuan
untuk menangkap mangsa.
Dalam programming, kita boleh menggunakan konsep ini untuk memudahkan
kita. Kita akan menggunakan tiga class ini (Harimau, HarimauBelang,
dan Cheetah) untuk lihat penggunaan polymorphism:
package harimau;

public class Harimau {

    public Harimau() {

    }

    public void tangkapMangsa() {
        System.out.println("Saya terus tangkap saja.");
    }
}

package harimau;

public class HarimauBelang extends Harimau {

    @Override
    public void tangkapMangsa() {
        System.out.println("Saya menyorok dahulu, kemudian terkam mangsa.");
    }

}

package harimau;

public class Cheetah extends Harimau {

    @Override
    public void tangkapMangsa() {
        System.out.println("Saya laju, saya kejar, saya ngap mangsa.");
    }

}

Kita boleh menggunakan nama superclass untuk merujuk kepada
subclass. Jadi, kita boleh create object seperti berikut:
package harimau;

public class Main {
    public static void main(String[] args) {
        Harimau harimau1 = new Harimau();
        Harimau harimau2 = new HarimauBelang();
        Harimau harimau3 = new Cheetah();
    }
}

Dengan adanya konsep polymorphism, kita boleh menggunakan method
yang sama tetapi melakukan kerja yang berbeza seperti berikut:
package harimau;

public class Main {
    public static void main(String[] args) {
        Harimau harimau1 = new Harimau();
        Harimau harimau2 = new HarimauBelang();
        Harimau harimau3 = new Cheetah();

        harimau1.tangkapMangsa();
        harimau2.tangkapMangsa();
        harimau3.tangkapMangsa();
    }
}

Antara kelebihan menggunakan polymorphism ialah kita boleh menggunakan
loop untuk melakukan method yang sama, contohnya jika kita ada lebih
daripada seribu jenis Harimau.

oop/string.html.body:
String
Kalau perasan jenis data String ditulis bermula dengan huruf besar,
berbanding jenis data yang lain seperti int, double, dan boolean.
Ini kerana String sebenarnya ialah class.
String merupakan gabungan daripada beberapa character (huruf, nombor,
simbol). Jadi, class String dibuat untuk menggabungkan character
tersebut.
Sama seperti class yang lain, String juga mempunyai method yang boleh kita
gunakan.
length
Kita boleh menggunakan method length() untuk mendapatkan panjang
sesuatu String atau dalam erti kata lain, untuk mendapatkan bilangan
character yang ada dalam sesuatu String:
package tutorialjava;

public class Main {
    public static void main(String[] args) {
        String cikgu = "Cikgu suka main bola, hari-hari cikgu main bola";
        int bilanganCharacter = cikgu.length();

        System.out.println(bilanganCharacter);
    }
}

Character yang dikira termasuklah tempat kosong (blank).
charAt
Method charAt() boleh digunakan untuk mendapatkan character daripada
String. Contohnya,
package tutorialjava;

public class Main {
    public static void main(String[] args) {
        String cikgu = "Cikgu suka main bola, hari-hari cikgu main bola";

        char hurufPertama = cikgu.charAt(0);
        char hurufKedua = cikgu.charAt(1);

        System.out.println(hurufPertama);
        System.out.println(hurufKedua);
    }
}

Dalam programming, kiraan biasanya dibuat bermula dari 0 seperti ini:
0, 1, 2, 3, 4, 5…
bukannya,
1, 2, 3, 4, 5…
toLowerCase/toUpperCase
Kita boleh menggunakan method toLowerCase() untuk menjadikan String
tersebut kepada huruf kecil semuanya. Method toUpperCase() pula untuk
menjadikan String kepada huruf besar.
package tutorialjava;

public class Main {
    public static void main(String[] args) {
        String cikgu = "Cikgu suka main bola, hari-hari cikgu main bola";
        String cikguHurufBesar = cikgu.toUpperCase();

        System.out.println(cikguHurufBesar);
    }
}

essentials/exception-part-1.html.body:
Exception (part 1)
Java menggunakan exception untuk mengendalikan error. Apabila
error berlaku, exception ini dilancarkan untuk menghentikan proses
yang mempunyai error.
Cara mudah untuk menghasilkan error adalah dengan membahagikan satu
nombor dengan kosong:
package essential;

public class BahagiKosong {
    public static void main(String[] args) {
        int a = 1 / 0;
    }
}

Apabila kita run code tersebut, program akan memaparkan teks
menjelaskan tentang error tersebut, iaitu ArithmeticException: / by
zero.
try-catch
Apabila exception berlaku, biasanya program akan terus tutup dan code
selepasnya tidak akan dilaksanakan. Contohnya,
package essential;

public class BahagiKosong {
    public static void main(String[] args) {
        int a = 1 / 0;
        System.out.println("ini selepas bahagi kosong");
    }
}

Jika kita mahu run code selepasnya, kita mesti handle exception itu
secara manual. Untuk handle exception, kita boleh menggunakan
try-catch seperti berikut:
package essential;

public class BahagiKosong {
    public static void main(String[] args) {
        try {
            int a = 1 / 0;
        } catch (ArithmeticException e) {
            System.out.println("tidak boleh bahagi kosong!");
        }

        System.out.println("ini selepas bahagi kosong");
    }
}

finally
Satu tambahan kepada try-catch ialah finally. Code di dalam
finally akan wajib dilaksanakan. Ini bertujuan jika ada exception
lain yang tidak disangkakan berlaku.
package essential;

public class BahagiKosong {
    public static void main(String[] args) {
        try {
            int a = 1 / 0;
        } catch (ArithmeticException e) {
            System.out.println("tidak boleh bahagi kosong!");
        } finally {
            System.out.println("ini confirm dilaksanakan");
        }

        System.out.println("ini selepas bahagi kosong");
    }
}

throws
Kita boleh menggunakan throws jika kita tidak mahu handle exception pada waktu
itu, mungkin kerana tidak mahu code serabut. Contoh jika kita throws exception
daripada suatu method, maka kita boleh catch di method yang lain.
package essential;

public class BahagiKosong {
    private static int bahagiKosong() throws ArithmeticException {
        return 1 / 0;
    }

    public static void main(String[] args) {
        try {
            int a = bahagiKosong();
        } catch (ArithmeticException e) {
            System.out.println("tidak boleh bahagi kosong!");
        }
    }
}

essentials/input-dari-user.html.body:
Input dari user
Antara keperluan yang patut ada pada sesuatu program ialah program itu
mestilah interaktif. Sesuatu program interaktif mestilah boleh mengambil
input untuk diproses. Beberapa cara untuk mendapatkan input dari user
termasuklah:

daripada command line interface (command prompt/terminal)
menggunakan graphical user interface (GUI)

Scanner
Sebelum kita ambil input daripada user, kita lihat class Scanner terlebih
dahulu. Class Scanner boleh digunakan untuk memisahkan sesuatu ayat
(atau string) kepada beberapa perkataan (atau token). Contohnya,
package essential;

import java.util.Scanner;

public class Input {
    public static void main(String[] args) {
        String cikgu = "Cikgu suka main bola, hari-hari cikgu main bola";

        Scanner scan = new Scanner(cikgu);

        while (scan.hasNext()) {
            System.out.println(scan.next());
        }
    }
}


Jangan lupa untuk import class Scanner berdasarkan code di atas.

Token tersebut boleh ditukar ke jenis data yang lain bergantung kepada
method yang digunakan, contohnya nextInt() menukarkan token kepada
integer, seperti berikut:
package essential;

import java.util.Scanner;

public class Input {
    public static void main(String[] args) {
        String cikgu = "12 tambah 23";

        Scanner scan = new Scanner(cikgu);

        int nomborPertama = scan.nextInt();

        String operasi = scan.next();  // ambil tetapi tidak diguna

        int nomborKedua = scan.nextInt();

        System.out.println(nomborPertama + nomborKedua);
    }
}

System.in
Untuk mendapatkan input daripada user melalui command line, kita letak
System.in pada Scanner seperti berikut:
package essential;

import java.util.Scanner;

public class Input {
    public static void main(String[] args) {
        Scanner scan = new Scanner(System.in);
    }
}

Kemudian apabila kita menggunakan salah satu method next(), program
akan tunggu input daripada kita. Contohnya,
package essential;

import java.util.Scanner;

public class Input {
    public static void main(String[] args) {
        Scanner scan = new Scanner(System.in);

        int nomborPertama;
        int nomborKedua;

        System.out.println("Kalkulator!! Tambah sahaja...");

        System.out.print("Masukkkan nombor pertama: ");
        nomborPertama = scan.nextInt();

        System.out.print("Masukkan nombor kedua: ");
        nomborKedua = scan.nextInt();

        System.out.println("Jawapan: " + (nomborPertama + nomborKedua));
    }
}

Method next() hanya mengambil satu token sahaja, jika mahu mengambil
seluruh input, gunakan method nextLine(), contohnya:
package essential;

import java.util.Scanner;

public class Input {
    public static void main(String[] args) {
        Scanner scan = new Scanner(System.in);

        String nama;

        System.out.println("Hi, siapa nama awak?");
        nama = scan.nextLine();

        System.out.println("Hi, " + nama + ". Selamat berkenalan!");
    }
}


Tips: Dalam Netbeans, tekan Ctrl+Shift+I untuk import class secara
automatik.

essentials/input-dari-file.html.body:
Input dari file
Kebanyakan program seperti Notepad, Photoshop, dan Word membenarkan user
untuk save kerja mereka di dalam komputer. Kemudian user boleh sambung
semula dengan menggunakan file yang di-save tersebut. Java juga ada
menyediakan class untuk mengambil input daripada file. Jadi, kita
akan lihat cara penggunaan class tersebut.
Sebelum itu, kita perlu membuat file terlebih dahulu dengan menggunakan
mana-mana text editor. Kita tulis apa-apa sahaja yang kita mahu di
dalam file tersebut. Selepas itu, kita save file tersebut
sebagai cubaan.txt atau apa-apa sahaja yang anda mahu. Kemudian kita
letakkan file tersebut di dalam folder project Netbeans.
FileReader
Kita boleh menggunakan class FileReader untuk mengambil input daripada
file. Untuk menggunakan class FileReader, kita perlu handle
exception untuk mengelakkan error, contohnya jika file tersebut
tidak wujud. Method read() boleh digunakan untuk mendapatkan
character daripada file. Selepas digunakan, class FileReader perlu
ditutup semula menggunakan method close().
package essential;

import java.io.FileReader;
import java.io.IOException;

public class InputDariFile {
    public static void main(String[] args) throws IOException {
        FileReader reader = null;

        try {
            reader = new FileReader("cubaan.txt");
            int input = reader.read();
            System.out.println(input);
        } finally {
            reader.close();
        }
    }
}

Selepas run, kita akan dapat satu nombor. Nombor ini ialah nombor
ASCII kerana komputer menyimpan data dalam bentuk nombor.
Klik untuk lihat senarai nombor ASCII
Untuk menukar nombor tersebut kepada character, kita boleh menggunakan
method Character.toChars():
package essential;

import java.io.FileReader;
import java.io.IOException;

public class InputDariFile {
    public static void main(String[] args) throws IOException {
        FileReader reader = null;

        try {
            reader = new FileReader("cubaan.txt");
            int input = reader.read();
            System.out.println(Character.toChars(input));
        } finally {
            reader.close();
        }
    }
}

dan kita akan mendapat character pertama yang kita tulis dalam file.
Untuk mendapatkan semua character, kita boleh menggunakan loop:
package essential;

import java.io.FileReader;
import java.io.IOException;

public class InputDariFile {
    public static void main(String[] args) throws IOException {
        FileReader reader = null;

        try {
            reader = new FileReader("cubaan.txt");

            int input;

            while ((input = reader.read()) != -1) {
                System.out.print(Character.toChars(input));
            }
        } finally {
            reader.close();
        }
    }
}

Loop tersebut akan berhenti apabila nombor yang dipulangkan bersamaan
-1 yang bermaksud tiada character lagi yang wujud.
BufferedReader
Sebelum ini kita lihat class FileReader mengambil satu character
pada satu masa. Cara ini sebenarnya tidak efisyen. Jadi, Java
menyediakan class BufferedReader untuk membuatkan proses mengambil
input lebih efisyen.
package essential;

import java.io.BufferedReader;
import java.io.FileReader;
import java.io.IOException;

public class InputDariFile {
    public static void main(String[] args) throws IOException {
        BufferedReader reader = null;
        try {
            reader = new BufferedReader(new FileReader("cubaan.txt"));

            String input = reader.readLine();
            System.out.println(input);
        } finally {
            reader.close();
        }
    }
}

Class FileReader masih digunakan cuma kali ini dibantu oleh class
BufferedReader. Method readLine() akan terus mengambil sepanjang
baris dalam file tersebut sebagai string.
Kita boleh menggunakan loop jika file tersebut mempunyai lebih
daripada satu baris:
package essential;

import java.io.BufferedReader;
import java.io.FileReader;
import java.io.IOException;

public class InputDariFile {
    public static void main(String[] args) throws IOException {
        BufferedReader reader = null;

        try {
            reader = new BufferedReader(new FileReader("cubaan.txt"));
            String input;

            while ((input = reader.readLine()) != null) {
                System.out.println(input);
            }
        } finally {
            reader.close();
        }
    }
}

essentials/output-ke-file.html.body:
Output ke file
Selain boleh mengambil input daripada file, program juga boleh output ke
file menggunakan class FileWriter. Sama seperti input, output juga
mempunyai class untuk menjadikan output lebih efisyen menggunakan
BufferedWriter.
FileWriter
Apabila kita menggunakan FileWriter, program akan create file walaupun
file tersebut tidak wujud pada asalnya. Jika file tersebut telah wujud,
FileWriter akan overwrite file tersebut. Sama seperti FileReader,
kita mesti handle exception untuk class FileWriter:
package essential;

import java.io.FileWriter;
import java.io.IOException;

public class OutputKeFile {
    public static void main(String[] args) throws IOException {
        FileWriter writer = null;

        try {
            writer = new FileWriter("dingdong.txt");
        } finally {
            writer.close();
        }
    }
}

Kita boleh menggunakan method write() untuk menulis character atau
string ke file:
package essential;

import java.io.FileWriter;
import java.io.IOException;

public class OutputKeFile {
    public static void main(String[] args) throws IOException {
        String cikgu = "Cikgu suka main bola, hari-hari cikgu main bola";

        FileWriter writer = null;

        try {
            writer = new FileWriter("dingdong.txt");
            writer.write(cikgu);
            writer.write(cikgu);  // tulis sekali lagi
        } finally {
            writer.close();
        }
    }
}

Perhatikan program hanya tulis output dalam satu baris.
Untuk tulis dalam  baris baru, kita tambah \r\n pada string tersebut:
package essential;

import java.io.FileWriter;
import java.io.IOException;

public class OutputKeFile {
    public static void main(String[] args) throws IOException {
        String cikgu = "Cikgu suka main bola, hari-hari cikgu main bola";

        FileWriter writer = null;

        try {
            writer = new FileWriter("dingdong.txt");
            writer.write(cikgu + "\r\n");
            writer.write(cikgu);
        } finally {
            writer.close();
        }
    }
}

Tambah string pada file yang asal
Kita boleh menggunakan constructor FileWriter(String fileName, boolean
append) untuk menentukan sama ada untuk menambah ke file yang asal
ataupun tidak. Letak true pada parameter boolean append untuk
menambah pada file yang asal:
package essential;

import java.io.FileWriter;
import java.io.IOException;

public class OutputKeFile {
    public static void main(String[] args) throws IOException {
        String cikgu = "Cikgu suka main bola, hari-hari cikgu main bola";

        FileWriter writer = null;

        try {
            writer = new FileWriter("dingdong.txt", true);
            writer.write(cikgu + "\r\n");
            writer.write(cikgu);
        } finally {
            writer.close();
        }
    }
}

Program akan sentiasa menambah string tersebut ke dalam file setiap kali
kita run code tersebut.
BufferedWriter
BufferedWriter boleh digunakan untuk menjadikan program lebih efisyen.
BufferedWriter digunakan untuk membantu FileWriter:
package essential;

import java.io.BufferedWriter;
import java.io.FileWriter;
import java.io.IOException;

public class OutputKeFile {
    public static void main(String[] args) throws IOException {
        String cikgu = "Cikgu suka main bola, hari-hari cikgu main bola";

        BufferedWriter writer = null;

        try {
            writer = new BufferedWriter(new FileWriter("dingdong.txt"));
            writer.write(cikgu);
            writer.newLine();
            writer.write(cikgu, 11, 9);  // offset 11 huruf, ambil 9 huruf
        } finally {
            writer.close();
        }
    }
}

Kita boleh menggunakan method newLine() untuk membuat baris baru. Kita juga
boleh menetapkan hanya sebahagian daripada string untuk keluar sebagai output.
Rujuk
BufferedWriter
untuk maklumat lanjut.

essentials/exception-part-2.html.body:
Exception (part 2)
Semasa membuat input/output, kita mesti membuat exception handling.
Jika perasan, semua class yang terlibat dengan input/output perlu
ditutup menggunakan method close() selepas digunakan. Contohnya,
package essential;

import java.io.BufferedReader;
import java.io.FileReader;
import java.io.IOException;

public class InputDariFile {
    public static void main(String[] args) throws IOException {
        BufferedReader reader =null;

        try {
            reader = new BufferedReader(new FileReader("cubaan.txt"));

            String input;

            while ((input = reader.readLine()) != null) {
                System.out.println(input);
            }
        } finally {
            reader.close();
        }
    }
}

Bagi mengelakkan programmer lupa untuk menutup semula class tersebut,
Java menyediakan satu lagi jenis exception handling iaitu
try-with-resources.
try-with-resources
Dalam try-with-resources, class yang digunakan untuk input/output
diletakkan di dalam kurungan selepas try:
package essential;

import java.io.BufferedReader;
import java.io.FileReader;
import java.io.IOException;
import java.util.logging.Level;
import java.util.logging.Logger;

public class InputDariFile {
    public static void main(String[] args) {
        try (BufferedReader reader = new BufferedReader(new FileReader("cubaan.txt"))) {
            String input;

            while ((input = reader.readLine()) != null) {
                System.out.println(input);
            }
        } catch (IOException ex) {
            // Handle exception
        }
    }
}

Jadi, Java akan tutup secara automatik class BufferedReader selepas
digunakan walaupun kita tidak meletakkan method close().
Keyword catch, finally, dan throws masih boleh digunakan seperti
biasa.

datastructure/array.html.body:
Array
Sebelum ini, kita menggunakan variable untuk menyimpan data. Walau
bagaimanapun variable hanya boleh menyimpan satu data sahaja pada satu
masa. Jika kita mahu menyimpan lebih daripada satu data, kita boleh
menggunakan array.
Cara untuk membuat array adalah seperti berikut:
package datastructure;

public class ContohArray {
    public static void main(String[] args) {
        int[] nomborBilik = new int[5];
    }
}

Nombor 5 tersebut bermaksud array nomborBilik hanya boleh menyimpan 5
data sahaja.
Untuk memasukkan data ke dalam array, kita tulis nama array tersebut
serta kedudukannya:
package datastructure;

public class ContohArray {
    public static void main(String[] args) {
        int[] nomborBilik = new int[5];
        nomborBilik[0] = 101;
        nomborBilik[1] = 202;
        nomborBilik[2] = 303;
        nomborBilik[3] = 404;
        nomborBilik[4] = 505;
    }
}

Perhatikan kedudukan di dalam array bermula dengan 0, bukannya 1.
Untuk mengakses kembali data di dalam array, juga sama, tulis nama
array serta kedudukannya:
package datastructure;

public class ContohArray {
    public static void main(String[] args) {
        int[] nomborBilik = new int[5];
        nomborBilik[0] = 101;
        nomborBilik[1] = 202;
        nomborBilik[2] = 303;
        nomborBilik[3] = 404;
        nomborBilik[4] = 505;

        System.out.println(nomborBilik[3]);
    }
}

Cara lain untuk membuat array adalah dengan menggunakan kurungan {}:
package datastructure;

public class ContohArray {
    public static void main(String[] args) {
        int[] nomborBilik = {101, 202, 303, 404, 505};
        System.out.println(nomborBilik[3]);
    }
}

Hati-hati semasa menggunakan array kerana saiz array tidak boleh
berubah. Sama juga jika menggunakan kurungan {}.
Multidimensional array
Ada sesetengah data memerlukan lebih daripada satu dimensi, contohnya
data spreadsheet seperti Excel yang menggunakan row dan column.
Jadi, kita boleh menggunakan multidimensional array.
package datastructure;

public class ContohArray {
    public static void main(String[] args) {
        String[][] jadual = new String[2][3];
        jadual[0][0] = "Sabtu";
        jadual[0][1] = "bangun pagi";
        jadual[0][2] = "gosok gigi";
        jadual[1][0] = "Ahad";
        jadual[1][1] = "bangun pagi";
        jadual[1][2] = "tidur balik";

        System.out.println(jadual[1][1]);
    }
}

Sama seperti array biasa, kita juga boleh menggunakan kurungan {}
untuk membuat multidimensional array:
package datastructure;

public class ContohArray {
    public static void main(String[] args) {
        String[][] jadual = { {"Sabtu", "bangun pagi", "gosok gigi"},
                              {"Ahad", "bangun pagi", "tidur balik"} };

        System.out.println(jadual[1][1]);
    }
}

datastructure/for-each-loop.html.body:
For each loop
Jika kita menggunakan sesebuah data structure, kebiasaannya akan ada
proses yang kita perlu buat kepada semua data di dalam data structure
tersebut. Untuk mengakses semua data, kita boleh menggunakan loop
seperti berikut:
