sahaja sudah tahu bahawa loop tersebut akan mengakses semua data dalam
sesebuah data structure.
Antara kelemahannya ialah for each loop tidak boleh akses dua data
pada satu masa. Contoh jika menggunakan loop biasa:
package datastructure;

public class ContohForEachLoop {
    public static void main(String[] args) {
        String[] names = {"John", "Jack", "Jill", "Jackson"};

        for (int i = 0; i

datastructure/list.html.body:
List
Antara class yang menggunakan interface List ialah ArrayList dan
LinkedList. Cara penggunaannya adalah seperti berikut:
package datastructure;

import java.util.ArrayList;
import java.util.List;

public class ContohList {
    public static void main(String[] args) {
        List names = new ArrayList<>();
        names.add("Abu");
        names.add("Ali");
        names.add("Atan");

        System.out.println("List yang asal:");

        for (String name : names) {
            System.out.println(name);
        }

        names.remove(1);

        System.out.println("Selepas buang nama di indeks 1:");

        for (String name : names) {
            System.out.println(name);
        }
    }
}

Java 7 dan ke atas membenarkan diamond interface seperti ini:
List names = new ArrayList<>();

Jika anda menggunakan Java 6 atau ke bawah, anda mungkin perlu menulis begini:
List names = new ArrayList();

Contoh di atas menggunakan method add() untuk menambah data ke dalam
List, dan method remove() untuk membuang data daripada List. Untuk
lihat method lain yang boleh digunakan, sila rujuk Java API.
Klik untuk lihat List di Java API
Cara lain untuk membuat List adalah dengan mengambil data daripada array
menggunakan method Arrays.asList():
package datastructure;

import java.util.ArrayList;
import java.util.Arrays;
import java.util.List;

public class ContohList {
    public static void main(String[] args) {
        String[] nameArray = {"Abu", "Ali", "Atan"};

        List names = new ArrayList<>(Arrays.asList(nameArray));

        System.out.println("List yang asal:");

        for (String name : names) {
            System.out.println(name);
        }

        names.remove(1);

        System.out.println("Selepas buang nama di indeks 1:");

        for (String name : names) {
            System.out.println(name);
        }
    }
}

Untuk menggunakan LinkedList, tukar sahaja ArrayList kepada
LinkedList, contohnya,
List names = new LinkedList<>();

Inilah kelebihan apabila menggunakan program to interface. Kita boleh terus
menukar class implementation tanpa mengubah bahagian code yang lain.
ArrayList vs LinkedList
Kita lihat cara penggunaan kedua-dua class tersebut adalah sama. Yang
membezakan ialah apa yang berlaku di dalam class tersebut.
Secara umumnya, class ArrayList adalah lebih baik. Jika program kita
banyak melibatkan add atau remove pada awal indeks, barulah
digalakkan menggunakan LinkedList. Itupun jika program tersebut tidak
banyak mengakses data daripada LinkedList tersebut. Kesimpulannya,
jika kita mahu menggunakan LinkedList, kita perlu lihat perbandingan
performance program kita menggunakan kedua-duanya terlebih dahulu.
Jika malas fikir banyak, guna sahaja ArrayList.
Tips untuk meningkatkan performance ArrayList adalah dengan menentukan
saiznya terlebih dahulu sesuai dengan data. Contohnya gunakan saiz 300
jika anda membuat program untuk check perkataan dari sebuah esei:
List words = new ArrayList<>(300);

Secara default, saiz ArrayList ialah 10.

datastructure/set.html.body:
Set
Set boleh digunakan untuk menyimpan data yang unik. Jika ada yang sama, Set akan
tetap menyimpan satu sahaja. Class yang menggunakan interface Set antaranya
ialah HashSet, TreeSet, dan LinkedHashSet.
HashSet
HashSet digunakan jika kita tidak kisah bagaimana kedudukan data di
dalam Set. Dari segi performance, HashSet adalah yang terbaik.
Contoh penggunaannya:
package datastructure;

import java.util.HashSet;
import java.util.Set;

public class ContohSet {
    public static void main( args) {
        Set kuih = new HashSet<>();
        kuih.add("karipap");
        kuih.add("donat");
        kuih.add("kuih lapis");
        kuih.add("karipap");

        for (String k : kuih) {
            System.out.println(k);
        }
    }
}

Hasilnya hanya satu karipap sahaja yang ada dalam Set tersebut
walaupun kita masukkan dua. Perhatikan juga kedudukan kuih tidak
mengikut urutan seperti yang kita masukkan.
TreeSet
TreeSet akan menyusun data di dalamnya mengikut nilai data tersebut,
contohnya jika nombor akan mengikut urutan angka naik, jika String akan
mengikut huruf:
package datastructure;

import java.util.Set;
import java.util.TreeSet;

public class ContohSet {
    public static void main(String[] args) {
        Set nombor = new TreeSet<>();
        nombor.add(10);
        nombor.add(10);
        nombor.add(5);
        nombor.add(12);

        for (Integer k : nombor) {
            System.out.println(k);
        }
    }
}

Dari segi performance, TreeSet adalah yang paling lambat.
LinkedHashSet
LinkedHashSet pula menyusun data mengikut urutan sebagaimana
urutan kita memasukkan data:
package datastructure;

import java.util.LinkedHashSet;
import java.util.Set;

public class ContohSet {
    public static void main(String[] args) {
        Set nombor = new LinkedHashSet<>();
        nombor.add(10);
        nombor.add(10);
        nombor.add(5);
        nombor.add(12);

        for (Integer k : nombor) {
            System.out.println(k);
        }
    }
}

Dari segi performance, LinkedHashSet hampir sama laju dengan
HashSet.
Buang duplicate
Set boleh digunakan untuk membuang duplicate daripada data structure
yang lain.
Contoh membuang duplicate dalam array:
package datastructure;

import java.util.Arrays;
import java.util.HashSet;
import java.util.Set;

public class ContohSet {
    public static void main(String[] args) {
        Integer[] nombor = {1, 1, 1, 1, 2, 3, 4, 4, 4, 5, 6, 6, 6, 6, 7};

        Set setNombor = new HashSet<>(Arrays.asList(nombor));

        Integer[] nomborTanpaDuplicate = setNombor.toArray(new Integer[0]);

        for (Integer n : nomborTanpaDuplicate) {
            System.out.println(n);
        }
    }
}


Parameter untuk method toArray() di atas hanya untuk menentukan jenis data
sahaja. Rujuk
toArray()
untuk maklumat lanjut.

Contoh membuang duplicate dalam List:
package datastructure;

import java.util.ArrayList;
import java.util.HashSet;
import java.util.List;
import java.util.Set;

public class ContohSet {
    public static void main(String[] args) {
        List listNama = new ArrayList<>();
        listNama.add("ali");
        listNama.add("ali");
        listNama.add("ali");

        Set setNama = new HashSet<>(listNama);

        listNama.clear();
        listNama.addAll(setNama);

        for (String nama : listNama) {
            System.out.println(nama);
        }
    }
}

datastructure/queue.html.body:
Queue
Queue menggunakan kaedah first in, first out (FIFO) yang bermaksud
data yang mula-mula masuk akan keluar dahulu. Sebagai contoh semasa
beratur di kantin, orang yang mula-mula datang yang akan dapat beli
dahulu, siapa yang lambat kena beratur di belakang.
Class yang menggunakan queue antaranya ialah LinkedList dan
PriorityQueue.
LinkedList
Contoh untuk membuat queue menggunakan LinkedList:
package datastructure;

import java.util.LinkedList;
import java.util.Queue;

public class ContohQueue {
    public static void main(String[] args) {
        Queue customers = new LinkedList<>();
        customers.offer("pelanggan pertama");
        customers.offer("pelanggan kedua");
        customers.offer("pelanggan ketiga");

        System.out.println("Ambik order " + customers.poll());
        System.out.println("Next!");
        System.out.println("Ambik order " + customers.poll());

        System.out.println("Alamak makanan sudah habis, siapa pelanggaan seterusnya?");
        System.out.println(customers.peek());
        System.out.println(customers.peek() + " sedang menunggu...");
    }
}

Method yang digunakan adalah seperti berikut:

offer() – untuk memasukkan data ke dalam Queue
poll() – mengeluarkan data untuk digunakan
peek() – mengakses data tanpa mengeluarkan data tersebut

PriorityQueue
Walaupun queue secara umumnya menggunakan kaedah FIFO, PriorityQueue
agak berlainan sedikit. Data di dalam PriorityQueue ditentukan
menggunakan priority (keutamaan). Data yang mempunyai keutamaan yang
tinggi akan didahulukan untuk keluar (diproses).
Contoh situasi sewaktu menaiki kapal terbang. Selepas penumpang diberi
kebenaran untuk masuk, pramugari pun minta warga emas yang naik dahulu,
kemudian penumpang yang ada anak kecil, diikuti oleh penumpang-penumpang
yang lain. Jadi, di sini warga emas mempunyai keutamaan (priority)
yang lebih tinggi berbanding penumpang yang lain.
Kita akan gunakan class Penumpang untuk dimasukkan ke dalam
PriorityQueue:
package datastructure;

public class Penumpang {
    String jenis;
    int keutamaan;      // nombor besar bermaksud high priority

    public Penumpang(String jenis, int keutamaan) {
        this.jenis = jenis;
        this.keutamaan = keutamaan;
    }
}

Bagi menentukan keutamaan sesuatu class, kita boleh menggunakan class
yang menggunakan interface Comparator:
package datastructure;

import java.util.Comparator;

public class KeutamaanPenumpang implements Comparator {

    @Override
    public int compare(Penumpang o1, Penumpang o2) {
        return o2.keutamaan - o1.keutamaan;
    }

}

Untuk interface Comparator, jika method compare() menghasilkan
nombor negatif bermaksud o1 lebih diutamakan, jika nombor positif
bermaksud o2 diutamakan, dan jika return 0 bermaksud sama
priority.
Kita mahu field keutamaan di class Penumpang menjadi high priority
jika nombor besar dan low priority jika nombor kecil, jadi kita
tentukan priority dengan cara,
o2.keutamaan – o1.keutamaan;

Jika diterbalikkan seperti ini,
o1.keutamaan – o2.keutamaan;

bermaksud nombor kecil ialah high priority, dan nombor besar ialah
low priority. Terpulang kepada anda hendak pilih yang mana.
Cara penggunaan PriorityQueue adalah seperti berikut:
package datastructure;

import java.util.PriorityQueue;
import java.util.Queue;

public class ContohQueue {
    public static void main(String[] args) {
        Queue airport = new PriorityQueue<>(new KeutamaanPenumpang());
        airport.offer(new Penumpang("lelaki dewasa bujang", 1));
        airport.offer(new Penumpang("wanita bujang", 1));
        airport.offer(new Penumpang("warga emas lelaki", 3));
        airport.offer(new Penumpang("pasangan pengantin", 1));
        airport.offer(new Penumpang("warga emas perempuan", 3));
        airport.offer(new Penumpang("ada anak kecil", 2));

        while (!airport.isEmpty()) {
            System.out.println(airport.poll().jenis);
        }
    }
}

Hasilnya Penumpang yang mempunyai keutamaan yang lebih tinggi akan
dikeluarkan dahulu.

datastructure/deque.html.body:
Deque
Deque (cara sebutan 'deck') boleh menggunakan kaedah first in, first
out (FIFO) dan last in, first out (LIFO). Cara untuk menggunakan
kaedah FIFO sama sahaja dengan menggunakan queue, jadi kita akan lihat
kaedah LIFO pula. Class yang menggunakan interface Deque ialah
ArrayDeque dan LinkedList.
ArrayDeque
Kaedah LIFO boleh diibaratkan seperti membuat burger. Kita letak
bahagian-bahagian burger bermula dari bawah ke atas. Apabila kita hendak
lihat daging apa, kita selak roti yang di atas.
Contoh kaedah LIFO menggunakan ArrayDeque:
package datastructure;

import java.util.ArrayDeque;
import java.util.Deque;

public class ContohDeque {
    public static void main(String[] args) {
        Deque burger = new ArrayDeque<>();
        burger.push("roti");
        burger.push("sayur");
        burger.push("daging");
        burger.push("roti");

        System.out.println("Susunan burger:");
        for (String partBurger : burger) {
            System.out.println(partBurger);
        }

        System.out.println("Oops, lupa letak sos!");
        String rotiDiTangan = burger.pop();   // keluarkan roti paling atas
        burger.push("sos + mayonis");   // tambah sos
        burger.push(rotiDiTangan);    // letak balik roti

        System.out.println("Susunan burger yang baru:");
        for (String partBurger : burger) {
            System.out.println(partBurger);
        }
    }
}

Method yang digunakan untuk LIFO ialah:

push() – untuk memasukkan data di hujung/atas
pop() – keluarkan data di hujung/atas
peek() – untuk mengakses data di hujung/atas tanpa mengeluarkan data tersebut

Method yang boleh digunakan untuk FIFO pula adalah sama seperti Queue
iaitu offer(), poll(), dan peek().
LinkedList
Cara gunanya sama sahaja dengan ArrayDeque. Secara umumnya,
ArrayDeque lebih efisyen berbanding LinkedList.

datastructure/map.html.body:
Map
Map digunakan untuk menghubungkan antara satu data (key) dengan data
yang lain (value). Array dan List menggunakan indeks untuk
menentukan data yang mana satu, manakala Map menggunakan key yang
kita letak untuk merujuk data yang mana.
Antara class yang menggunakan interface Map ialah HashMap,
TreeMap, dan LinkedHashMap. Kalau perasan nama ketiga-tiga class
tersebut lebih kurang sama dengan nama untuk class Set. Ini bermaksud
fungsi ketiga-tiga class Map tersebut sama sahaja dengan class Set.
Contoh penggunaan Map:
package datastructure;

import java.util.HashMap;
import java.util.Map;

public class ContohMap {
    public static void main(String[] args) {
        Map harga = new HashMap<>();
        harga.put("burger_ayam", 2.0);
        harga.put("burger_ayam_special", 3.6);
        harga.put("burger_ayam_double_special", 5.4);

        System.out.printf("Harga burger ayam: RM %.2f", harga.get("burger_ayam"));
        System.out.println();
    }
}

Berpandukan Java API, interface Map adalah seperti berikut:
public interface Map

Ini bermaksud kita perlu meletakkan dua jenis data untuk generics K
(key) dan V (value). Oleh itu, code di atas bermaksud key kita
ialah jenis String dan value kita ialah jenis Double.
Method yang boleh digunakan ialah,

put() – untuk memasukkan data
get() – untuk mengakses data menggunakan key

Cara untuk mendapatkan semua key
Kita boleh menggunakan method keySet() untuk mendapatkan senarai
key yang ada dalam sesebuah Map:
package datastructure;

import java.util.HashMap;
import java.util.Map;
import java.util.Set;

public class ContohMap {
    public static void main(String[] args) {
        Map harga = new HashMap<>();
        harga.put("burger_ayam", 2.0);
        harga.put("burger_ayam_special", 3.6);
        harga.put("burger_ayam_double_special", 5.4);

        System.out.println("Senarai burger:");

        Set senaraiBurger = harga.keySet();

        for (String burger : senaraiBurger) {
            System.out.println(burger);
        }
    }
}

dan boleh digunakan seperti berikut:
package datastructure;

import java.util.HashMap;
import java.util.Map;

public class ContohMap {
    public static void main(String[] args) {
        Map harga = new HashMap<>();
        harga.put("burger_ayam", 2.0);
        harga.put("burger_ayam_special", 3.6);
        harga.put("burger_ayam_double_special", 5.4);

        for (String key : harga.keySet()) {
            System.out.printf("Harga %s : RM %.2f", key, harga.get(key));
            System.out.println();
        }
    }
}

Jika mahu ikut susunan seperti mana yang kita masukkan, tukar sahaja
dari HashMap ke LinkedHashMap.
MultiMap
MultiMap ialah Map yang membenarkan satu key merujuk beberapa
value. Interface Map yang biasa hanya membenarkan satu key untuk
merujuk satu value sahaja. Java tidak menyediakan MultiMap tetapi
dengan sedikit trick, kita boleh membuat MultiMap menggunakan Map
yang biasa.
Trick tersebut adalah dengan menggunakan mana-mana data structure
sebagai value, contohnya:
package datastructure;

import java.util.ArrayList;
import java.util.HashMap;
import java.util.List;
import java.util.Map;

public class ContohMap {
    public static void main(String[] args) {
        Map> haiwan = new HashMap<>();

        haiwan.put("karnivor", new ArrayList<>());
        haiwan.get("karnivor").add("harimau");
        haiwan.get("karnivor").add("singa");

        haiwan.put("omnivor", new ArrayList<>());
        haiwan.get("omnivor").add("beruang");
        haiwan.get("omnivor").add("ayam");

        for (String karnivor : haiwan.get("karnivor")) {
            System.out.println(karnivor);
        }
    }
}

database/jdbc.html.body:
JDBC
JDBC ialah interface yang kita boleh guna untuk menyambungkan aplikasi Java
dengan database. Benda yang diperlukan untuk membuat connection JDBC ialah url,
nama dan password untuk database tersebut.
Contoh url untuk database H2 ialah seperti,
jdbc:h2:~/tempat/letak/db
Contoh untuk Windows,
jdbc:h2:C:/tempat/letak/db
Contoh menggunakan database client/server,
jdbc:mysql://websitesaya.com:9001/nama_database
Setup projek
Kita akan membuat projek menggunakan Maven. Di sini, saya menggunakan IDE
IntelliJ Community Edition (Free). Jadi, buka IntelliJ. Kemudian, klik Create
New Project. Di sebelah kiri, pilih Maven dan klik Next.
GroupId ialah nama package untuk menentukan bahawa projek tersebut ialah milik
kita, biasanya kita letak mengikut nama domain. Jika anda tidak memiliki domain,
suka hati anda nak letak apa. Jadi, saya akan letak com.jombelajarjava sebagai
GroupId. ArtifactId pula ialah nama package untuk projek kita. Jadi, saya
akan letakkan tutorialh2. Setelah selesai, klik Next.
Di skrin berikutnya, tentukan di mana anda ingin meletakkan folder untuk projek
anda. Kemudian, klik Finish.
Setelah selesai, IntelliJ akan membina projek Maven dan anda akan nampak file
XML seperti ini,


    4.0.0

    com.jombelajarjava
    tutorialh2
    1.0-SNAPSHOT




File ini bernama pom.xml. File inilah tempat untuk kita menentukan config untuk projek Maven.
Untuk menambah library database H2, tambah config ini di pom.xml:


        com.h2database
        h2
        1.4.196



File pom.xml kemudiannya akan kelihatan seperti ini:


    4.0.0

    com.jombelajarjava
    tutorialh2
    1.0-SNAPSHOT



            com.h2database
            h2
            1.4.196





Anda boleh check version library tersebut di
Maven Central.
Jika anda menggunakan IntelliJ, IntelliJ akan tanya sama ada anda ingin download
library H2 tersebut, maka download sahaja.
Class Main
Code Java untuk projek Maven kebiasaannya diletakkan di dalam folder
src/main/java. Jadi, right click folder tersebut, kemudian New dan klik
Java Class. Letakkan nama class termasuk nama package, contoh yang saya akan
guna, com.jombelajarjava.H2Application.
Class H2Application kita jadikan sebagai class untuk aplikasi. Di sini kita
akan letakkan config untuk database. Kita juga akan meletakkan code untuk mula
membina database dalam method init(). Oleh itu, class H2Application pada
awalnya akan kelihatan seperti ini:
package com.jombelajarjava;

class H2Application {
    private static final String DATABASE_URL = "jdbc:h2:~/tutorialh2/db";
    private static final String NAME = "root";
    private static final String PASSWORD = "root";

    H2Application() {
        init();
    }

    private void init() {

    }
}


Perhatian, dalam situasi sebenar, elakkan dari meletakkan nama dan password
dalam code. Biasanya kita perlu dapatkan maklumat tersebut daripada
environment variable ataupun file yang berasingan supaya lebih selamat.

Selepas ini, dalam folder yang sama, create class Main untuk kita letakkan
main() method untuk run aplikasi tersebut. Class Main akan menjadi seperti
ini,
package com.jombelajarjava;

public class Main {
    public static void main(String[] args) {
        H2Application app = new H2Application();
    }
}

Menggunakan database
Untuk menggunakan database daripada aplikasi Java, kita perlu membuat dua
langkah ini:

Membuat connection ke database.
Menjalankan code SQL.

Untuk membuat connection, kita boleh menggunakan class DriverManager. Sebagai
contoh, kita akan buat dalam method init() yang sedia ada, seperti ini:
private void init() {
    Connection conn;
    try {
        conn = DriverManager.getConnection(DATABASE_URL, NAME, PASSWORD);
        conn.close();
    } catch (SQLException e) {
        e.printStackTrace();
    }
}

Selepas selesai dengan panggilan database, kita perlu menutup semula connection
tersebut dengan menggunakan method close().
Untuk menjalankan code SQL daripada connection tersebut, kita boleh menggunakan
method createStatement() atau prepareStatement(). Daripada statement
tersebut kita boleh jalankan code SQL menggunakan method executeUpdate() atau
executeQuery(). Contoh:
private void init() {
    Connection conn;
    Statement stmt;
    try {
        conn = DriverManager.getConnection(DATABASE_URL, NAME, PASSWORD);
        stmt = conn.createStatement();
        stmt.executeUpdate(
            "CREATE TABLE IF NOT EXISTS KUCING (" +
                "ID IDENTITY, " +
                "NAMA VARCHAR(100) NOT NULL, " +
                "JANTINA ENUM('jantan', 'betina'), " +
                "TARIKH_LAHIR DATE NOT NULL" +
            ")");
        stmt.close();
        conn.close();
    } catch (SQLException e) {
        e.printStackTrace();
    }
}

Statement juga sama seperti Connection, perlu ditutup menggunakan method
close() setelah digunakan.
try-with-resources
Jika kita lihat code tersebut agak menyusahkan kerana perlu close() setiap
masa. Jika anda masih ingat, dalam tutorial
Exception, kita ada belajar
try-with-resources. Jadi, kita akan menggunakannya di sini. Code terbaru
kemudiannya akan menjadi seperti ini:
private void init() {
    try (Connection conn = DriverManager.getConnection(DATABASE_URL, NAME, PASSWORD);
         Statement stmt = conn.createStatement()) {
        stmt.executeUpdate(
            "CREATE TABLE IF NOT EXISTS KUCING (" +
                "ID IDENTITY, " +
                "NAMA VARCHAR(100) NOT NULL, " +
                "JANTINA ENUM('jantan', 'betina'), " +
                "TARIKH_LAHIR DATE NOT NULL" +
            ")");
    } catch (SQLException e) {
        e.printStackTrace();
    }
}

Jika anda menggunakan IntelliJ, IntelliJ akan complain kerana
try-with-resources ialah feature Java 7 dan ke atas. Untuk selesaikannya,
tekan Alt+Enter kemudian pilih Set language level to 7. IntelliJ akan
menambah config pada pom.xml secara automatik. Anda boleh nampak config baru
dalam file pom.xml, iaitu



            org.apache.maven.plugins
            maven-compiler-plugin

                1.7
                1.7





Sekarang barulah kita boleh run aplikasi kita.
Run code
Semasa development, kita boleh saja terus run menggunakan IntelliJ tanpa
menggunakan Maven. Jadi kita run seperti biasa, klik kanan pada class Main
kemudian klik Run 'Main.main()'. Setelah selesai, H2 akan create table
KUCING.
H2 Console
Antara feature yang saya suka pada H2 ialah H2 Console. Jika anda pernah
menggunakan database seperti MySQL, anda mungkin perlu setup phpMyAdmin untuk
melihat kandungan database tersebut di browser.
Dengan H2, kita hanya perlu run library JAR H2 untuk mendapatkan fungsi yang
sama. Jadi, cari file JAR yang di download oleh Maven. Di komputer saya (Linux),
lokasi tersebut ialah
~/.m2/repository/com/h2database/h2/1.4.196
Setelah cd ke lokasi tersebut, kita boleh run H2 Console menggunakan command
java -jar h2-1.4.196.jar
Browser akan automatik terbuka dengan GUI ke database H2. Masukkan URL, nama,
dan password yang sama untuk lihat kandungan database kita dan anda akan dapat
lihat kita ada table KUCING yang kita create sebelum ini.
Anda boleh lihat di
sini
cara untuk buka H2 Console jika anda menggunakan Windows.

database/dao-dan-service.html.body:
DAO dan Service
Sebelum kita tulis lebih banyak SQL query, kita akan lihat bagaimana untuk
menyusun code kita dengan lebih teratur. Cara ini memang biasa digunakan dalam
industri.
Data Access Object (DAO)
DAO ialah class yang kita boleh gunakan untuk membuat operasi melibatkan
database. Class ini akan memisahkan code aplikasi dengan code database, jadi
apabila kita ingin membuat operasi database, kita hanya perlu memanggil method
yang ada dalam DAO.
Kelebihan menggunakan class DAO ialah kita boleh mengubah code database tanpa
perlu menyentuh code aplikasi. Contoh apabila kita mahu tukar dari H2 ke
PostgreSQL, atau dari hanya JDBC ke
jOOQ.
Service
Service pula ialah class untuk kita letakkan lojik bisnes (business logic),
maksudnya mana-mana code yang kita perlu tulis untuk menentukan apa yang patut
berlaku dengan data, proses apa yang perlu digunakan, dan sebagainya. Disebabkan
aplikasi yang kita akan buat agak simple, lojik bisnes yang kita akan buat
hanyalah untuk menggunakan method dari class DAO.
Model
Kita boleh menyusun data dari setiap table dalam database menggunakan class.
Class ini disebut sebagai model layer. Dalam tutorial sebelum ini, kita ada
membuat table bernama Kucing yang mempunyai id, nama, jantina, dan tarikh lahir.
Jadi, kita boleh menyusun semua data tersebut dalam sebuah class bernama Kucing.
Di sini saya letakkan class tersebut di dalam package
com.jombelajarjava.kucing.
Class tersebut akan kelihatan seperti ini:
package com.jombelajarjava.kucing;

import java.time.LocalDate;

public class Kucing {
    private final Long id;
    private final String nama;
    private final Jantina jantina;
    private final LocalDate tarikhLahir;

    public Kucing(final String nama, final Jantina jantina, final LocalDate tarikhLahir) {
        this(0L, nama, jantina, tarikhLahir);
    }

    public Kucing(final Long id, final String nama, final Jantina jantina, final LocalDate tarikhLahir) {
        this.id = id;
        this.nama = nama;
        this.jantina = jantina;
        this.tarikhLahir = tarikhLahir;
    }

    public Kucing cloneWithId(final Long id) {
        return new Kucing(id, nama, jantina, tarikhLahir);
    }

    public Long getId() {
        return id;
    }

    public String getNama() {
        return nama;
    }

    public Jantina getJantina() {
        return jantina;
    }

    public LocalDate getTarikhLahir() {
        return tarikhLahir;
    }

}

Jika anda menggunakan IDE, IDE akan complain mengenai LocalDate kerana package
java.time adalah daripada Java 8. Jadi, kita update sahaja pom.xml untuk
menggunakan Java 8, seperti ini,



            org.apache.maven.plugins
            maven-compiler-plugin

                1.8
                1.8





Enum
Jika anda perasan, dalam class Kucing ada jenis data bernama Jantina. Kita
boleh membuat jenis data rekaan sendiri menggunakan enum. Untuk membuat enum,
tulis sahaja seperti ini,
package com.jombelajarjava.kucing;

import java.util.Locale;

public enum Jantina {
    JANTAN, BETINA
}

Walaupun enum di atas nampak ok, tetapi jika kita lihat kembali dalam database,
enum untuk Jantina menggunakan huruf kecil. Jadi kita perlu mengubahsuai enum
tersebut supaya menggunakan huruf kecil apabila di-print.
package com.jombelajarjava.kucing;

import java.util.Locale;

public enum Jantina {
    JANTAN("jantan"), BETINA("betina");

    private final String text;

    Jantina(final String text) {
        this.text = text;
    }

    @Override
    public String toString() {
        return text;
    }
}

Interface KucingDAO
Sebelum kita menulis DAO untuk mengakses database, kita akan membuat interface
terlebih dahulu untuk merancang apa yang perlu ada pada class DAO nanti. Dengan
membuat interface, kita juga boleh memberitahu programmer lain dalam team (jika
ada) method yang akan ada dalam class DAO nanti tanpa perlu menunggu kita
menyiapkan class DAO tersebut.
Interface DAO untuk Kucing kelihatan seperti ini:
package com.jombelajarjava.kucing;

import java.util.List;

public interface KucingDao {
    List findAll();
    List findById(Long id);
    List findByNama(String nama);
    Kucing insertKucing(Kucing kucing);
    Kucing updateKucing(Kucing kucing);
    boolean deleteKucing(Kucing kucing);
}

Perhatikan jenis data yang return daripada method insert, update, dan
delete. Ada sesetengah orang lebih suka hanya return int, ada yang hanya
return void. Semua boleh. Di sini saya return balik object untuk insert dan
update, dan boolean untuk check jika telah berjaya delete.
Class SimpleKucingDAO
Sekarang kita boleh implement interface KucingDao. Jika anda menggunakan IDE,
selepas menulis
public class SimpleKucingDao implements KucingDao {

}

IDE boleh terus tambah method daripada KucingDao secara automatik. Contoh dalam
IntelliJ, boleh tekan Alt+Enter. Kemudian tambah constructor untuk mengambil
data yang diperlukan untuk membuat sambungan ke database.
package com.jombelajarjava.kucing;

import java.sql.*;
import java.util.List;

public class SimpleKucingDao implements KucingDao {
    private final String url;
    private final String name;
    private final String password;

    public SimpleKucingDao(final String url, final String name, final String password) {
        this.url = url;
        this.name = name;
        this.password = password;
    }

    @Override
    public List findAll() {
        return null;
    }

    @Override
    public List findById(final Long id) {
        return null;
    }

    @Override
    public List findByNama(final String nama) {
        return null;
    }

    @Override
    public Kucing insertKucing(final Kucing kucing) {
          return null;
    }

    @Override
    public Kucing updateKucing(final Kucing kucing) {
        return null;
    }

    @Override
    public boolean deleteKucing(final Kucing kucing) {
        return false;
    }
}

Jika anda lihat di industri, kadang kala class DAO dinamakan sebagai
KucingDaoImpl atau IKucingDao. Isu ini pun ada perbincangan dan debat,
masing-masing mempunyai pandangan dan hujah masing-masing. Ada yang suka, ada
yang tak suka.
Secara peribadi, saya tak suka sebab bila lihat standard library Java, tidak ada
satu pun class yang menggunakan Impl. Kalau ada satu class sahaja yang
implement interface DAO tersebut, saya lebih suka menamakannya
DefaultKucingDao contohnya. Jadi, tidak ada salah tidak ada betul. Ikut sahaja
mana-mana yang digunakan dalam syarikat, asalkan konsisten.

Update: Akhirnya saya telah jumpa class yang berakhir dengan Impl dalam
standard library, iaitu
SocketImpl.
Hmm...

Class PendaftaranService
Selepas wujud DAO, kita boleh membuat service untuk memanggil method daripada
DAO tersebut,
package com.jombelajarjava.daftar;

import com.jombelajarjava.kucing.Kucing;
import com.jombelajarjava.kucing.KucingDao;

import java.util.List;

public class PendaftaranService {
    private final KucingDao kucingDAO;

    public PendaftaranService(final KucingDao kucingDAO) {
        this.kucingDAO = kucingDAO;
    }

    public List searchAll() {
        return kucingDAO.findAll();
    }

    public List searchById(final Long id) {
        return kucingDAO.findById(id);
    }

    public List searchByNama(final String nama) {
        return kucingDAO.findByNama(nama);
    }

    public Kucing add(final Kucing kucing) {
        return kucingDAO.insertKucing(kucing);
    }

    public Kucing edit(final Kucing kucing) {
        return kucingDAO.updateKucing(kucing);
    }

    public boolean remove(final Kucing kucing) {
        return kucingDAO.deleteKucing(kucing);
    }
}


Jika anda mengikuti tutorial ini sehingga habis, anda mungkin merasakan semua
class dan interface ini seperti tidak berfaedah. Ya, saya setuju. Cara ini
biasanya digunakan dalam team yang mempunyai quality assurance(QA) yang
melibatkan testing. Jadi, mereka boleh terus menggunakan interface untuk menulis
test, contohnya,
public KucingDAOTest implements KucingDAO {
    // Code untuk test
}

Lagipun, sekarang telah banyak wujud framework dan library sehingga kita tidak
perlu lagi menulis implementation DAO dan interface service. Kita akan lihat
framework dan library tersebut pada tutorial akan datang.

database/crud.html.body:
CRUD
CRUD ialah akronim (acronym) untuk Create, Read, Update dan Delete.
Keempat-empat operasi tersebut ialah operasi yang biasa digunakan dengan
database.

Create - mencipta/membuat/memasukkan data
Read - membaca/mengambil data
Update - mengolah/mengemaskini data
Delete - membuang/memadam data

Jadi setiap kali membuat project yang melibatkan database, anda boleh terus
sahaja menyediakan keempat-empat operasi tersebut.
CRUD dalam KucingDao
Berbalik ke aplikasi kita sebelum ini, operasi CRUD kita adalah seperti berikut:



Operasi
Method dalam KucingDao




Create
insertKucing()


Read
findAll(), findById(), findByNama()


Update
updateKucing()


Delete
deleteKucing()



Insert
Saya akan membuat contoh untuk membuat operasi Insert dalam SimpleKucingDao.
Caranya sama sahaja seperti membuat table, tetapi kita perlu menjadikan SQL
query tersebut boleh mengambil data daripada code Java. Caranya adalah dengan
menggunakan PreparedStatement:
    @Override
    public Kucing insertKucing(final Kucing kucing) {
        final String insertQuery = "INSERT INTO KUCING(NAMA, JANTINA, TARIKH_LAHIR) VALUES(?, ?, ?)";

        try (Connection conn = DriverManager.getConnection(url, name, password);
             PreparedStatement stmt = conn.prepareStatement(insertQuery)) {
            stmt.setString(1, kucing.getNama());
            stmt.setString(2, kucing.getJantina().toString());
            stmt.setDate(3, Date.valueOf(kucing.getTarikhLahir()));

            stmt.executeUpdate();

            try (ResultSet generatedKeys = stmt.getGeneratedKeys()) {
                if (generatedKeys.next()) {
                    final Long id = generatedKeys.getLong(1);
                    return kucing.cloneWithId(id);
                }
            }
        } catch (SQLException e) {
            e.printStackTrace();
        }

        return kucing;
    }

Letakkan tanda soal, ?, dalam SQL query sebagai tempat untuk kita masukkan
data. Untuk mendapatkan PreparedStatement, gunakan method prepareStatement()
dari Connection.
Kemudian, untuk memasukkan data kita gunakan pelbagai method set yang ada
mengikut jenis data tersebut. Contoh,
stmt.setString(1, kucing.getNama());

bermaksud masukkan nama kucing di tempat (tanda soal) pertama.
Dengan menggunakan JDBC, kita boleh mendapatkan kembali ID yang terhasil
daripada proses Insert seperti code di atas, iaitu,
            try (ResultSet generatedKeys = stmt.getGeneratedKeys()) {
                if (generatedKeys.next()) {
                    final Long id = generatedKeys.getLong(1);
                    return kucing.cloneWithId(id);
                }
            }

Selepas mendapatkan ID, saya create object Kucing baru dengan data yang sama
tetapi disertakan dengan ID.

Anda mungkin tertanya-tanya kenapa saya tidak menggunakan method setId()
misalannya. Kalau tengok kembali pada class Kucing, semua fields saya letakkan
keyword final. Keyword final akan menjadikan field tersebut tidak boleh
berubah. Ada sebabnya, tetapi saya akan jelaskan pada tutorial akan datang.

Code untuk operasi CRUD yang lain saya serahkan kepada pembaca sebagai latihan.
Ambil input
Sekarang kita sudah boleh membuat code aplikasi untuk berinteraksi dengan
pengguna kemudian memasukkan data ke dalam database.
Initialize PendaftaranService dan Scanner di constructor H2Application:
    private final PendaftaranService pendaftaranService;
    private final Scanner scan;

    H2Application() {
        pendaftaranService = new PendaftaranService(new SimpleKucingDao(DATABASE_URL, NAME, PASSWORD));
        scan = new Scanner(System.in);

        init();
    }


Sebenarnya ada cara yang lebih baik berbanding menggunakan new untuk
menggunakan service dan DAO iaitu dengan menggunakan dependency injection
framework, tetapi ini hanya untuk demo penggunaan database. Jadi, kita buat
dependency injection menggunakan new sahaja.

Kita paparkan arahan aplikasi kepada pengguna dalam method start(), kemudian
ambil input:
    void start() {
        System.out.print("Selamat Datang ke Pendaftaran Pet Kucing!\n" +
                "\n" +
                "Tekan nombor mengikut senarai di bawah:\n" +
                "1. Daftar kucing.\n" +
                "2. Tukar maklumat kucing.\n" +
                "3. Padam maklumat kucing.\n" +
                "4. Senaraikan semua kucing.\n" +
                "5. Cari kucing mengikut nama.\n" +
                "\n" +
                "Pilihan: ");

        final int nombor = Integer.parseInt(scan.nextLine().trim());

        switch (nombor) {
            case 1:
                daftarKucing();
                break;
            default:
                break;
        }

        scan.close();
    }

Method daftarKucing():
    private void daftarKucing() {
        System.out.print("\nMasukkan nama kucing: ");
        final String nama = scan.nextLine().trim();

        System.out.print("Masukkan jantina kucing ([J/j]antan/[B/b]etina): ");
        final char jantina = scan.nextLine().trim().charAt(0);

        System.out.print("Masukkan tarikh lahir (yyyy-mm-dd): ");
        final LocalDate tarikhLahir = LocalDate.parse(scan.nextLine().trim());

        final Kucing kucing = new Kucing(nama, jantina, tarikhLahir);
        final Long id = pendaftaranService.add(kucing).getId();

        System.out.println("\nPendaftaran selesai.\nID kucing anda: " + id);
    }

Perhatikan kita hanya mengambil char untuk menentukan Jantina sedangkan
class Kucing memerlukan data jenis enum. Oleh itu, kita perlu

mengubahsuai class Kucing untuk menerima char sebagai penentu Jantina
mengubahsuai enum Jantina untuk memilih enum mengikut char

Enum Jantina dari character
Tambah method fromChar() pada enum Jantina:
    public static Jantina fromChar(final char firstChar) {
        for (Jantina jantina : Jantina.values()) {
            if (String.valueOf(jantina.text.charAt(0)).equalsIgnoreCase(String.valueOf(firstChar))) {
                return jantina;
            }
        }
        return null;
    }

Method tersebut bermaksud untuk setiap nilai enum Jantina yang ada, bandingkan
huruf pertama dengan input tidak kira sama ada huruf besar atau kecil, jika sama
pulangkan nilai enum tersebut.
Overload contructor Class Kucing
Overload constructor untuk class Kucing:
    public Kucing(final String nama, final char jantina, final LocalDate tarikhLahir) {
        this(nama, Jantina.fromChar(jantina), tarikhLahir);
    }

Demo
Setelah selesai semuanya, gunakan method start() untuk menjalankan aplikasi:
package com.jombelajarjava;

public class Main {
    public static void main(String[] args) {
        H2Application app = new H2Application();
        app.start();
    }
}

Anda boleh ke sini untuk lihat code yang lengkap.

database/connection-pool.html.body:
Connection Pool
Pool dalam English bermaksud 'kolam'. Biasanya orang menyimpan ikan yang ditangkap ke dalam kolam untuk diguna/dimakan di kemudian hari. Jadi, connection pool bermaksud 'kolam connection database', supaya kita boleh menggunakan connection yang sudah disambung untuk membuat operasi database berkali-kali.
Penyambungan ke database yang kita buat sebelum ini sebenarnya kurang efisyen terutamanya untuk aplikasi yang berjalan lama seperti web kerana kita perlu membuat penyambungan ke database semula tiap kali kita melakukan operasi database.
HikariCP
Kita boleh menulis sendiri code untuk membuat connection pool, tapi tak perlulah. Kita guna saja library yang telah banyak membuat research untuk menjadikan connection pool lebih efisyen. Saya perkenalkan, HikariCP.
HikariCP digunakan secara default jika anda menggunakan web framework seperti Spring Boot, Play Framework atau Luminus.
Setup
HikariCP ialah library Java, jadi kita tambah sahaja di file pom.xml:

    com.zaxxer
    HikariCP
    2.6.2


Untuk membuat sambungan ke database menggunakan HikariCP, tambah code berikut di constructor H2Application:
HikariConfig config = new HikariConfig();
config.setJdbcUrl(DATABASE_URL);
config.setUsername(NAME);
config.setPassword(PASSWORD);

Tambah field untuk DataSource:
private final DataSource dataSource;

dan initialize field tersebut menggunakan config yang telah dibuat:
dataSource = new HikariDataSource(config);

getConnection()
Untuk membuat operasi database, kita boleh menggunakan method getConnection() daripada DataSource.
Sebagai contoh, sebelum ini di dalam method init(), kita menggunakan DriverManager untuk mendapatkan Connection. Jadi, ganti sahaja code
DriverManager.getConnection(DATABASE_URL, NAME, PASSWORD)

ke
dataSource.getConnection()

Update DAO
Untuk menggunakan DataSource yang sama, hantar sahaja field tersebut melalui constructor untuk DAO.
Tukar constructor SimpleKucingDao daripada
public SimpleKucingDao(final String url, final String name, final String password) {
    this.url = url;
    this.name = name;
    this.password = password;
}

ke
public SimpleKucingDao(final DataSource dataSource) {
    this.dataSource = dataSource;
}

Kemudian hantar dataSource sebagai argument di constructor H2Application:
pendaftaranService = new PendaftaranService(new SimpleKucingDao(dataSource));

Setelah selesai, bolehlah ganti semua code yang menggunakan DriverManager ke DataSource.
Code yang lengkap boleh dilihat di sini.

quality/immutable-collections.html.body:
Immutable Collections
Dalam tutorial final, variable tidak akan berubah apabila diletakkan keyword
final, tetapi bagaimana pula untuk Collections seperti List, Map, dan Set?
Kita boleh buat sedikit eksperimen seperti ini:
final List cubaan = new ArrayList<>(Arrays.asList("satu", "dua", "tiga"));
cubaan.add("empat");

System.out.println(cubaan);

Jika anda cuba code di atas, program akan print keempat-empat string tersebut.
Maksudnya nilai variable tersebut berubah. Jadi, apa yang berlaku?
Sebenarnya dalam Java, apa yang berlaku apabila kita meletakkan final untuk
object ialah cuma reference kepada object yang tidak berubah tetapi kandungan
object masih boleh berubah.
Ini contoh yang akan membuatkan program mengeluarkan error untuk Collections:
final List cubaan = new ArrayList<>(Arrays.asList("satu", "dua", "tiga"));
cubaan = new ArrayList<>();

Jadi, sekarang kita akan lihat bagaimana untuk mencapai const correctness
untuk Collections.
Unmodifiable Collections
Cara yang paling senang adalah dengan menggunakan method unmodifiableXXX()
yang ada dalam java.util.Collections. Contoh untuk List:
final List namaKucingJantan = Collections.unmodifiableList(Arrays.asList("Atan", "Boboi", "Tom"));
namaKucingJantan.add("Lisa");

Code di atas akan mengeluarkan error kerana kita tidak boleh modify List
tersebut.
Walaupun cara ini mudah, tetapi ada sedikit isu kerana method
unmodifiableXXX() hanya memberi view, bukannya Collection yang betul-betul
Collection. Kalau ada reference lain yang refer ke List yang asal, List
tersebut masih boleh diubah. Contoh:
final List listAsal = new ArrayList<>(Arrays.asList("satu", "dua", "tiga"));
final List listBaru = Collections.unmodifiableList(listAsal);
listAsal.add("empat");

System.out.println(listBaru);

Bagi mengatasi masalah ini, kita perlu menggunakan library yang mempunyai
immutable collections.
Immutable Collections
Antara library yang saya biasa guna yang ada immutable collections ialah
Vavr dan
Google Guava. Saya akan cadangkan Vavr
untuk sesiapa yang biasa dengan functional programming, jadi untuk tutorial
ini saya akan gunakan Google Guava.
Google Guava
Seperti biasa, kita perlu dapatkan library Guava terlebih dahulu. Jadi tambah
ini ke file pom.xml jika anda menggunakan Maven (atau apa saja cara yang anda
tahu untuk menambah library):

    com.google.guava
    guava
    23.6-jre


Guava juga ada versi untuk Android dengan menukar version ke 23.6-android.
Rujuk documentation di GitHub.
Contoh penggunaan immutable collections dengan Guava adalah seperti ini (ini
akan menghasilkan error):
final List cubaan = ImmutableList.of("satu", "dua", "tiga");
cubaan.add("empat");

Ini pula contoh untuk menggabungkan immutable list menggunakan method
concat() dari class Iterables:
final List namaKucingJantan = ImmutableList.of("Atan", "Boboi", "Tom");
final List namaKucingBetina = ImmutableList.of("Lisa", "Tasha", "Mimi");

final Iterable namaKucing = Iterables.concat(namaKucingJantan, namaKucingBetina);

System.out.println(namaKucing);

Kalau perasan, hasil dari concat ialah interface Iterable. Jika anda
ingin menggunakan method-method yang ada pada interface List contohnya
method size(), anda boleh menggunakan method yang ada pada library Guava.
Contohnya:
final List namaKucingJantan = ImmutableList.of("Atan", "Boboi", "Tom");
final List namaKucingBetina = ImmutableList.of("Lisa", "Tasha", "Mimi");

final Iterable namaKucing = Iterables.concat(namaKucingJantan, namaKucingBetina);
final int bilanganNamaKucing = Iterables.size(namaKucing);

System.out.println(bilanganNamaKucing);

Apa-apa rujuk JavaDoc Google Guava.

quality/convenience-library.html.body:
Convenience Library
Dalam tutorial sebelum-sebelum ini, saya ada memperkenalkan beberapa library
Java antaranya Guice,
Vavr, dan
Guava. Semua library tersebut boleh
dikategorikan sebagai convenience library.
Convenience bermaksud 'kemudahan'. Jadi, convenience library bermaksud
library yang memudahkan kita untuk program menggunakan Java.
Kebanyakan programmer tidak suka menggunakan Java kerana perlu menulis banyak
syntax hanya untuk melakukan benda yang simple. Oleh itu, beberapa library dibina
bagi mengurangkan bilangan code yang perlu ditulis. Pada pendapat saya, semakin
kurang code yang perlu ditulis semakin kurang kesilapan yang akan berlaku kerana
manusia mudah melakukan kecuaian.
Antara convenience library yang saya sudah perkenalkan:

Google Guava - Selain immutable collections, ada kemudahan lain yang ada
dalam library Guava. Anda boleh lihat documentation di GitHub.

Google Guice - Jika kita tidak menggunakan framework untuk membuat
dependency injection, kita perlu tulis sendiri class untuk injection.

Vavr - Kepada sesiapa yang ada pengalaman menggunakan Java 8 akan tahu syntax
yang baru masih ada kelemahannya. Jadi Vavr memudahkan lagi penggunaan syntax
Java 8. Sangat digalakkan kepada yang minat functional programming tetapi
terpaksa menggunakan Java.


Sekarang saya akan memperkenalkan satu lagi convenience library yang betul-betul
akan mengurangkan bilangan code Java, iaitu
Project Lombok.
Project Lombok
Lombok ialah library untuk menghasilkan constructor, getter, setter,
toString(), hashCode() dan sebagainya hanya dengan menggunakan annotation.
Lombok akan generate code yang diperlukan sebelum Java compile program kita.
Untuk menggunakan Lombok, tambah dependency di pom.xml (Maven):

    org.projectlombok
    lombok
    1.16.18
    provided


Jika anda menggunakan IDE seperti IntelliJ, anda boleh download plugin untuk
Lombok supaya IDE tersebut faham annotation Lombok. Rujuk documentation
Project Lombok.
Katakanlah kita perlu membuat class untuk menyimpan semua maklumat mengenai
Pengguna seperti nama, umur, jantina, alamat, email, telefon, no akaun bank, dan
sebagainya, field tersebut akan kelihatan seperti ini:
import java.sql.Timestamp;

public class Pengguna {
    private String nama;
    private int umur;
    private String jantina;
    private String alamat1;
    private String alamat2;
    private String email;
    private String telefonBimbit;
    private String telefonRumah;
    private String namaBank;
    private String noAkaunBank;
    private String noAkaunKwsp;
    private Timestamp waktuDaftar;
    private Timestamp waktuKemaskini;
}

Cuba bayangkan berapa banyak getter dan setter yang perlu ditulis hanya
untuk class ini.
Untuk menggunakan Lombok, tambah sahaja annotation. Contoh untuk
menghasilkan getter, setter, dan toString(), anda hanya perlu menambah
annotation @Data. Untuk menghasilkan constructor, tambah
@AllArgsConstructor. Contoh seperti berikut:
import lombok.AllArgsConstructor;
import lombok.Data;

import java.sql.Timestamp;

@Data
@AllArgsConstructor
public class Pengguna {
    private String nama;
    private int umur;
    private String jantina;
    private String alamat1;
    private String alamat2;
    private String email;
    private String telefonBimbit;
    private String telefonRumah;
    private String namaBank;
    private String noAkaunBank;
    private String noAkaunKwsp;
    private Timestamp waktuDaftar;
    private Timestamp waktuKemaskini;
}

dan segala-galanya sudah siap.
Untuk test class ini, kita boleh cuba seperti ini:
import java.sql.Timestamp;

import static java.time.Instant.now;

public class Main {
    public static void main(final String[] args) {
        final Pengguna kassim = new Pengguna(
                "Kassim",
                25,
                "Lelaki",
                "123, Jalan 1",
                "Kampung Dusun",
                "kassimkgdusun@gmail.com",
                "012-1234567",
                "01-1234567",
                "CIMB Bank",
                "123456ABC",
                "ABC123456",
                Timestamp.from(now()),
                null);

        System.out.println(kassim);

        kassim.setUmur(26);

        System.out.println(kassim);
    }
}

Delombok
Jika anda ingin melihat bagaimana Lombok generate code untuk sesuatu class,
anda boleh menggunakan Delombok.
Jika anda menggunakan IntelliJ, anda boleh klik kanan pada annotation Lombok,
kemudian Refactor > Delombok, dan pilih annotation yang anda mahu
Delombok-kan.
Feature ini juga boleh digunakan jika team anda tidak pandai atau enggan
menggunakan Lombok.

quality/recursion.html.body:
Recursion
Recursion ialah apabila kita memanggil sesebuah method dalam method yang sama.
Teknik ini antara bahagian yang memeningkan pelajar universiti. Jika anda sama
pening dengan konsep ini semasa di universiti, anda tidak perlu bimbang kerana
recursion sangat jarang digunakan dalam Java.
Recursion tidak digalakkan dalam Java kerana Java tiada tail call
optimization. Jika kita melakukan recursion dengan banyak, program akan
mengakibatkan stackoverflow error.
Pendek kata, elakkan recursion.
Jika anda masih degil, mari kita lihat contoh recursion:
public class Main {
    private static int jumlahSampaiSeribu(int nombor) {
        if (nombor == 1000) {
            return nombor;
        }

        return nombor + jumlahSampaiSeribu(nombor + 1);
    }

    public static void main(String[] args) {
        int hasil = jumlahSampaiSeribu(1);
        System.out.println(hasil);
    }
}

Apa yang berlaku apabila kita memanggil method tambahSampaiSeribu() ialah
panggilan-panggilan tersebut menjadi berangkai, hasilnya menjadi,
return 1 + 2 + 3 + 4... + 1000;

Semasa memanggil semula method tersebut, maklumat untuk operasi tambah antara
semua angka-angka masih perlu disimpan dalam memory sehinggalah nombor
bersamaan dengan 1000, di mana method recursive tidak lagi dipanggil.
Yang menyebabkan stackoverflow error itu berpunca daripada semua data untuk
angka, data untuk operasi apa, dan data untuk method return nilai ke mana,
melebihi muatan stack memory. Jika anda tidak dapat stackoverflow error,
anda boleh tambahkan nilai daripada seribu ke sejuta misalannya.
Stack vs Heap Memory
Stack memory ialah memory yang digunakan untuk meletakkan maklumat mengenai
program kita, contohnya variable dan maklumat untuk method. Heap memory pula
ialah memory yang digunakan untuk meletakkan data-data yang dibina semasa
program sedang berjalan, contohnya semasa membuat object menggunakan new.
Stack memory biasanya berada di cache CPU, dia laju, tetapi saiznya kecil. Itu
sebabnya kita boleh mendapat stackoverflow error semasa membuat recursion.
Program perlu menyimpan maklumat mengenai method yang belum selesai dikira.
Tail call recursion
Tail call recursion ialah recursion untuk membuat benda yang sama tetapi
menggunakan cara yang sedikit berbeza. Ini contohnya,
public class Main {
    private static int jumlahSampaiSeribuTailCall(int nombor, int jumlah) {
        if (nombor == 1000) {
            return nombor + jumlah;
        }

        return jumlahSampaiSeribuTailCall(nombor + 1, nombor + jumlah);
    }

    public static void main(String[] args) {
        int hasil = jumlahSampaiSeribuTailCall(1, 0);
        System.out.println(hasil);
    }
}

Bezanya adalah kita terus return panggilan untuk recursive method, tidak lagi
berangkai seperti sebelum ini.
Cara ini mungkin boleh mengurangkan risiko stackoverflow error kerana stack
memory tidak perlu lagi menyimpan maklumat untuk operasi apa yang perlu
dilakukan. Hanya perlu menyimpan maklumat ke mana method tersebut perlu return.
Walaubagaimanapun, stackoverflow error masih boleh berlaku dalam Java jika
panggilan kepada method recursive terlalu banyak.
Tail call optimization
Ada sesetengah programming language yang mempunyai tail call optimization.
Apabila kita membuat tail call recursion, program akan automatik menukarnya ke
bentuk goto (ataupun dipanggil jump). Maka, maklumat untuk method return ke
mana tidak perlu disimpan sekaligus mengelakkan berlakunya stackoverflow
error.
Malang sekali, Java tiada tail call optimization. Antara programming language
yang mempunyai tail call optimization ialah Scheme.
